"use strict";let BaseURL=window.location.origin;document.getElementById("form-acceso").addEventListener("submit",async e=>{e.preventDefault();try{ShowPreloader();let e=new FormData;e.append("CorreoElectronico",document.getElementById("correo-electronico").value),e.append("Contrasena",Base64.encode(document.getElementById("contrasena").value)),e.append("Dispositivo",platform.os.family),e.append("Fabricante",platform.manufacturer),e.append("Navegador",platform.name);let a=await axios({url:"/default/acceder",baseURL:BaseURL,method:"POST",headers:{"X-CSRF-TOKEN":document.head.querySelector("[name~=csrf-token][content]").content},data:e});HidePreloader();let t=a.data;switch(t.code){case 200:window.location.href="/inicio";break;case 500:Swal.fire({title:"¡Error!",text:t.data,imageUrl:window.SadOwl,imageWidth:100,imageHeight:123,background:"#000000",color:"#FFFFFF",imageAlt:"Error Image"});break;default:Swal.fire({title:"¡Alerta!",text:t.data,imageUrl:window.IndifferentOwl,imageWidth:100,imageHeight:123,imageAlt:"Alert Image",background:"#000000",color:"#FFFFFF"})}}catch(e){HidePreloader(),Swal.fire({title:"¡Error!",text:e,imageUrl:window.SadOwl,imageWidth:100,imageHeight:123,background:"#000000",color:"#FFFFFF",imageAlt:"Error Image"})}});